import React from 'react';

const List = ({list, instruments}) => {
var i = 0;

    return (
        <div>
            <h3 className="listTitle">Lista:</h3>
            <table className="myTable">
                {
                instruments.map(item =>{
                    i++
                    return (

                        <tbody>
                            <tr>
                                <th scope="row">{i}</th>
                                <td><img className="listImage" src={item.picture} alt={item.name}/></td>
                                <td>{item.name}</td>
                            </tr>
                        </tbody>
                    )
                })    
                }
            </table>
        </div>
    )
}

export default List;
